import React from 'react';
import { Link } from '@reach/router';

// eslint-disable-next-line
export default (props) => {
    return (
        <div>
            {/* make sure products are in ARRAY */}
            <Link to="/products/:id">

            {props.products.map((product, idx)=>{
                return <p key={idx}>{product.title}</p>
            })}

            </Link>
        </div>
    )
}


